function Plate (){
	const title = 'Гора Муелды';

    return(
        <div>
            <div class="billet">

					<div class="billet__select">
						<h1 class="billet__head">{title}</h1>

						<img src={'./img/mueldy.JPG'}></img>

						<div class="billet__btn">
							<a href="./#" class="billet__btn_link"><span>Начать тур</span></a>
						</div>
					</div>
				</div>
        </div>
    )
}

export default Plate;
